window.bookSummaryJSON = "<p><b>Elaine's mission through the fairy ring went horribly wrong, and she finds herself in Pallos once againâ€”over 20,000 years in the future.</b></p> <p>All she has are her friends, her magic, and the clothes on her back. Fighting their way out of the wilderness, they quickly meet Iona, a wandering paladin of the Valkyrie order.</p> <p>She's heading to the School of Sorcery and Spellcraft, and Elaine joins her: To learn wizardry. To figure out her place in the world and where she wants to go next. To get her third class. To kiss cute women. To eat some tasty mangos. To read books, at long last.</p>"; 
